  UNIQUE KEY `uniqcdetype` (`no`,`type`) USING BTREE COMMENT '唯一索引'
) ENGINE=InnoDB AUTO_INCREMENT=277 DEFAULT CHARSET=utf8 COMMENT='数据字典';

