#
# Function "CalculatingDistance"
#

DROP FUNCTION IF EXISTS `CalculatingDistance`;
CREATE FUNCTION `CalculatingDistance`(
	LAT_A FLOAT,
	LON_A FLOAT,
	LAT_B FLOAT,
	LON_B FLOAT
) RETURNS double
    DETERMINISTIC
BEGIN
DECLARE tempCalc DOUBLE;
if LAT_A is null then   
set LAT_A = 0;   
end if; 
if LON_A is null then   
set LON_A = 0;   
end if; 
if LAT_B is null then   
set LAT_B = 0;   
end if; 
if LON_B is null then   
set LON_B = 0;   
end if; 
if LAT_A = 0 then   
set tempCalc = 99999;
RETURN tempCalc;
end if; 
if LON_A = 0 then   
set tempCalc = 99999;
RETURN tempCalc;
end if; 
if LAT_B = 0 then   
set tempCalc = 99999;
RETURN tempCalc;
end if; 
if LON_B = 0 then   
set tempCalc = 99999;
RETURN tempCalc;
end if; 
SET tempCalc = round((2*ATAN2(SQRT(SIN((LAT_A-LAT_B)*PI()/180/2)
		*SIN((LAT_A-LAT_B)*PI()/180/2)+
		COS(LAT_B*PI()/180)*COS(LAT_A*PI()/180)
		*SIN((LON_A-LON_B)*PI()/180/2)
		*SIN((LON_A-LON_B)*PI()/180/2)),
		SQRT(1-SIN((LAT_A-LAT_B)*PI()/180/2)
		*SIN((LAT_A-LAT_B)*PI()/180/2)
		+COS(LAT_B*PI()/180)*COS(LAT_A*PI()/180)
		*SIN((LON_A-LON_B)*PI()/180/2)
		*SIN((LON_A-LON_B)*PI()/180/2))))*6371,2);
RETURN tempCalc;
END;

#
# Function "queryDept"
#

DROP FUNCTION IF EXISTS `queryDept`;
CREATE FUNCTION `queryDept`(id_ BIGINT(20)) RETURNS varchar(4000) CHARSET latin1
BEGIN
      DECLARE sTemp VARCHAR(4000);
      DECLARE sTempChd VARCHAR(4000);
      DECLARE iTemp Int;

      SET sTemp = '';
      SET sTempChd = id_;
        SET iTemp = 0;

      WHILE sTempChd is not NULL DO
              IF iTemp = 0 THEN
                SET sTemp = '';
              ELSE
                IF sTemp = '' THEN
                  SET sTemp = sTempChd;
                ELSE
                  SET sTemp = CONCAT(sTemp,',',sTempChd);
                END IF;
              END IF;
            SELECT group_concat(id) INTO sTempChd FROM sys_department where FIND_IN_SET(pid, sTempChd)>0;
            SET iTemp = iTemp + 1;
      END WHILE;
      return sTemp;
END;

#
# Function "queryRoles"
#

DROP FUNCTION IF EXISTS `queryRoles`;
CREATE FUNCTION `queryRoles`(id_ BIGINT(20)) RETURNS varchar(4000) CHARSET utf8
    DETERMINISTIC
BEGIN
      DECLARE sTemp VARCHAR(4000);
      DECLARE sTempChd VARCHAR(4000);
      DECLARE iTemp Int;

      SET sTemp = '';
      SET sTempChd = id_;
        SET iTemp = 0;

      WHILE sTempChd is not NULL DO
              IF iTemp = 0 THEN
                SET sTemp = '';
              ELSE
                IF sTemp = '' THEN
                  SET sTemp = sTempChd;
                ELSE
                  SET sTemp = CONCAT(sTemp,',',sTempChd);
                END IF;
              END IF;
            SELECT group_concat(id) INTO sTempChd FROM sys_role where FIND_IN_SET(pid, sTempChd)>0;
            SET iTemp = iTemp + 1;
      END WHILE;
      return sTemp;
END;
